export const Transactions = (props) => {
  let i = 0;

  const getMoreInfo = () => {
    console.log("More Info");
  };

  return (
    <div>
      <h1>List of Txs:</h1>
      {props.txs.map((el, i) => {
        return (
          <ul key={i}>
            {el} <button onClick={getMoreInfo}>More Info</button>
          </ul>
        );
      })}
    </div>
  );
};

export default Transactions;
